import React, {Fragment} from 'react';
import '@lottiefiles/lottie-player';

import { withNamespaces } from 'react-i18next';
import FaceIcon from '@material-ui/icons/Face';
import LockIcon from '@material-ui/icons/Lock';
import {Link} from "react-router-dom";
const FormComponent =({t}) => {
    return <Fragment>
        <div className="form">

            <div className="sh_form">
                <lottie-player src="https://assets9.lottiefiles.com/packages/lf20_p6zljijz.json"  background="transparent"  speed="1"  style={{width: '300px', height: '300px', display: 'flex', margin: 'auto', justifyContent: 'center'}}loop  autoplay/>

                <div className="sh_block sh__mt2">
                    <button type="button" className="sh_btn sh_w100" onClick={()=>console.log('')}>CONTINUE</button>
                    <Link to="/register" className="sh_btn sh_block">REGISTER</Link>
                </div>
            </div>
        </div>
    </Fragment>
}

export default withNamespaces()(FormComponent);
